ST.xhtml:
// Export the Syslog
IF bLogExport THEN
	bLogExport := FALSE;
	FOR i := 0 TO 5 DO
		iModules[i].accept(exportVisitor);
	END_FOR
END_IF

// Export for XML
IF bXmlExport THEN
	bXmlExport := FALSE;
	FOR i := 0 TO 5 DO
		iModules[i].accept(exportXML);
	END_FOR
	bExecSave := TRUE;
END_IF

IF exportXML.saveDoc(bExec := bExecSave) THEN
	bExecSave := FALSE;
END_IF

InterfaceAsPlainText.xhtml:
PROGRAM MAIN
VAR
	// Program Objects
	fbHeater			: ARRAY[0..2] OF FB_Heater;
	fbConveyor 			: ARRAY[0..1] OF FB_Conveyor;
	fbIPCDiagnostics 	: FB_IPCDiagnostics;
	iModules 			: ARRAY[0..5] OF I_SysModules := [fbHeater[0], fbHeater[1], fbHeater[2], fbConveyor[0],  fbConveyor[1], fbIPCDiagnostics];

	// Visitor Object Control
	exportVisitor 		: FB_SysLogExporter;
	exportXML			: FB_XmlExporter('C:\TwinCAT\Visitor.xml', 'CX-12345');

	// Demo Program Control
	bLogExport			: BOOL;
	bXmlExport			: BOOL;
	bExecSave			: BOOL;
	i					: INT;
END_VAR

ST.xhtml:
THIS^.sFilePath := sFilePath;
THIS^.sMachineName := sMachineName;

(* Create an empty XML document *)
objRoot := fbXml.GetDocumentNode();

(* Create a new XML node 'Machines' and add to the empty document *)
objMachines := fbXml.AppendNode(objRoot, 'Machines');

(* Create a new XML node 'Machine' and add an attribute to this node. Append node to 'Machines' *)
objMachine := fbXml.AppendNode(objMachines, 'Machine');
objAttribute := fbXml.AppendAttribute(objMachine, 'Name', sMachineName);

(* Create a new XML node 'Controllers' and add to the 'Machine' node *)
objModules := fbXml.AppendNode(objMachine, sMachineName);

(* Retrieve XML document and store in a variable of data type STRING(1000) *)
nLength := fbXml.CopyDocument(sXmlString, SIZEOF(sXmlString));

SaveDoc := fbXml.SaveDocumentToFile(sFile := THIS^.sFilePath, bExec := bExec);

Path := fbConveyor.pPath;
Position := TO_STRING(fbConveyor.pPosition);
Velocity := TO_STRING(fbConveyor.pVelocity);
Status := fbConveyor.pStatus;

objModule := fbXml.AppendChild(objModules, 'Conveyor', Path, FALSE);
objAttribute := fbXml.AppendAttribute(objModule, 'Position', Position);
objAttribute := fbXml.AppendAttribute(objModule, 'Velocity', Velocity);
objAttribute := fbXml.AppendAttribute(objModule, 'Status', Status);

