FUNCTION_BLOCK FB_XmlExporter IMPLEMENTS I_Visitor
VAR
	sFilePath 		: STRING;
	sMachineName 	: STRING;	

	fbXml			: FB_XmlDomParser;
	objRoot 		: SXmlNode;
	objMachines 	: SXmlNode;
	objMachine		: SXmlNode;
	objModules		: SXmlNode;
	objModule		: SXmlNode;
	objAttribute 	: SXmlAttribute;
	sXmlString		: STRING(1000);
	nLength   		: UDINT;
END_VAR

